import React from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import img01 from '../../assets/clusterB/BFront/image_01.png';
import img02 from '../../assets/clusterB/BFront/image_02.png'; 

const BFront: React.FC = () => {
    const navigate = useNavigate();
    const { clusterId } = useParams<{ clusterId: string }>(); // Get route param

    const handleClick = (event: React.MouseEvent<SVGImageElement, MouseEvent>) => {
        const FloorId = event.currentTarget.id; // Get the ID of clicked Floor
        navigate('/clusterView/' + clusterId + '/' + FloorId);
    };



    return (
        <svg xmlns="http://www.w3.org/2000/svg" preserveAspectRatio='none' className='fullScreenSvg' xmlnsXlink="http://www.w3.org/1999/xlink" width="2000" height="2334" viewBox="0 0 2000 2334">
            <image id="Layer_0" data-name="Layer 0" width="2000" height="2334" xlinkHref={img01} />
            <image id="groundFloor" className='villa-B' onClick={(event: React.MouseEvent<SVGImageElement, MouseEvent>) => handleClick(event)} x="198" y="1616" width="1616" height="271" xlinkHref={img02} />
            <image id="firstFloor" className='villa-B' onClick={(event: React.MouseEvent<SVGImageElement, MouseEvent>) => handleClick(event)} x="174" y="1314" width="1665" height="365" xlinkHref="data:img/png;base64," />
            <image id="secondFloor" className='villa-B' onClick={(event: React.MouseEvent<SVGImageElement, MouseEvent>) => handleClick(event)} x="189" y="862" width="1651" height="631" xlinkHref="data:img/png;base64," />
        </svg>

    );
};

export default BFront;